import {} from '../actions/types';

const initialState = {};

export default function (state = initialState, { type, payload }) {
    switch (type) {
        case GET_INVOICE_INIT_STATE:
            return { ...payload };
        // case UPDATE_INVOICE:
        //     return { ...state, details: [...payload] };
        default:
            return state;
    }
}
